    "state-boundary-polygon",nt"isopen": false,nt"url": null,nt"notes":
    "This dataset portrays the state boundary based on the 2010 Cadastral National
    Spatial Data Infrastructure (CADNSDI) Geographic Coordinate Data Base (GCDB) distribution.
    The GCDB was acquired from a Premier Data contract in coordination with the BLM
    state GCDB Data Stewards to deliver a standardized GCDB product. This product would
    be capable, where GCDB data exists, to identify the State borders. Where GCDB data
    does not exist, in cases or rivers, lakes, and unsurveyed terrain, then alternative
    sources were used to identify the state boundary. Alternative sources include original
    24K USGS Maps and US Forest Service Cartographic Feature File (CFF) PLSS data.",nt"license_title":
